import React from 'react';
import AdminLogin from '../components/AdminLogin';
import StudentLogin from '../components/StudentLogin';

const LoginPage = () => {
  return (
    <div className="login-page">
      <h1>Login</h1>
      <div className="login-options">
        <AdminLogin />
        <StudentLogin />
      </div>
    </div>
  );
};

export default LoginPage;
